import React from "react";
import { MDBInput, MDBCol} from "mdbreact";

const SearchBar = () => {
    return (
        <MDBCol className="search-bar" md="6">
            <MDBInput hint="Search for a city" type="text" containerClass="mt-0" />
        </MDBCol>
    );
}

export default SearchBar;
